require.config({"config": {
        "jsbuild":{"Magento_MediaGalleryUi/js/action/deleteImageWithDetailConfirmation.js":"/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\ndefine([\n    'jquery',\n    'underscore',\n    'Magento_MediaGalleryUi/js/action/getDetails',\n    'Magento_MediaGalleryUi/js/action/deleteImages',\n    'mage/translate'\n], function ($, _, getDetails, deleteImages, $t) {\n    'use strict';\n\n    return {\n\n        /**\n         * Get information about image use\n         *\n         * @param {Array} recordsIds\n         * @param {String} imageDetailsUrl\n         * @param {String} deleteImageUrl\n         */\n        deleteImageAction: function (recordsIds, imageDetailsUrl, deleteImageUrl) {\n            var confirmationContent = $t('%1Are you sure you want to delete \"%2\" image(s)?')\n                .replace('%2', Object.keys(recordsIds).length),\n                deferred = $.Deferred();\n\n            getDetails(imageDetailsUrl, recordsIds).then(function (images) {\n                        confirmationContent = confirmationContent.replace(\n                            '%1',\n                            this.getRecordRelatedContentMessage(images) + ' '\n                        );\n                    }.bind(this)).fail(function () {\n                        confirmationContent = confirmationContent.replace('%1', '');\n                    }).always(function () {\n                        deleteImages(recordsIds, deleteImageUrl, confirmationContent).then(function (status) {\n                            deferred.resolve(status);\n                        }).fail(function (error) {\n                            deferred.reject(error);\n                        });\n                    });\n\n            return deferred.promise();\n        },\n\n        /**\n         * Get information about image use\n         *\n         * @param {Object|String} images\n         * @return {String}\n         */\n        getRecordRelatedContentMessage: function (images) {\n            var usedInMessage = $t('The selected assets are used in the content of the following entities: '),\n                usedIn = {};\n\n            $.each(images, function (key, image) {\n                $.each(image.details, function (sectionIndex, section) {\n                    if (section.title === 'Used In' && _.isObject(section) && !_.isEmpty(section.value)) {\n                        $.each(section.value, function (entityTypeIndex, entityTypeData) {\n                            usedIn[entityTypeData.name] = entityTypeData.name in usedIn ?\n                                usedIn[entityTypeData.name] + entityTypeData.number :\n                                entityTypeData.number;\n                        });\n                    }\n                });\n            });\n\n            if (_.isEmpty(usedIn)) {\n                return '';\n            }\n\n            return usedInMessage + this.usedInObjectToString(usedIn);\n        },\n\n        /**\n         * Fromats usedIn object to string\n         *\n         * @param {Object} usedIn\n         * @return {String}\n         */\n        usedInObjectToString: function (usedIn) {\n            var entities = [];\n\n            $.each(usedIn, function (entityName, number) {\n                entities.push(entityName + '(' + number + ')');\n            });\n\n            return entities.join(', ') + '.';\n        }\n    };\n});\n","Magento_MediaGalleryUi/js/action/getDetails.js":"/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\ndefine([\n    'jquery',\n    'mage/translate'\n], function ($, $t) {\n    'use strict';\n\n    return function (imageDetailsUrl, imageIds) {\n        var deferred = $.Deferred(),\n            message;\n\n        $.ajax({\n            type: 'GET',\n            url: imageDetailsUrl,\n            dataType: 'json',\n            showLoader: true,\n            data: {\n                'ids': imageIds\n            },\n            context: this,\n\n            /**\n             * Resolve with image details if success, reject with response message othervise\n             *\n             * @param {Object} response\n             */\n            success: function (response) {\n                if (response.success) {\n                    deferred.resolve(response.imageDetails);\n\n                    return;\n                }\n\n                deferred.reject(response.message);\n            },\n\n            /**\n             * Extract the message and reject\n             *\n             * @param {Object} response\n             */\n            error: function (response) {\n\n                if (typeof response.responseJSON === 'undefined' ||\n                    typeof response.responseJSON.message === 'undefined'\n                ) {\n                    message = $t('Could not retrieve image details.');\n                } else {\n                    message = response.responseJSON.message;\n                }\n                deferred.reject(message);\n            }\n        });\n\n        return deferred.promise();\n    };\n});\n","Magiccart_Magicslider/js/media-uploader.js":"/**\n *\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n\n/* eslint-disable no-undef */\n\n/**\n * @api\n */\n\n/*global byteConvert*/\ndefine([\n    'jquery',\n    'mage/template',\n    'Magento_Ui/js/modal/alert',\n    'Magento_Ui/js/form/element/file-uploader',\n    'mage/translate',\n    'jquery/uppy-core'\n], function ($, mageTemplate, alert, FileUploader) {\n    'use strict';\n\n    let fileUploader = new FileUploader({\n        dataScope: '',\n        isMultipleFiles: true\n    });\n\n    fileUploader.initUploader();\n\n    $.widget('mage.mediaUploader', {\n\n        /**\n         *\n         * @private\n         */\n        _create: function () {\n            let self = this,\n                arrayFromObj = Array.from,\n                progressTmpl = mageTemplate('[data-template=\"uploader\"]'),\n                uploaderElement = '.fileUploader',\n                targetElement = this.element.find('.fileinput-button.form-buttons')[0],\n                uploadUrl = this.element.find(uploaderElement).attr('data-url'),\n                fileId = null,\n                allowedExt = ['jpeg', 'jpg', 'png', 'gif'],\n                allowedResize = false,\n                options = {\n                    proudlyDisplayPoweredByUppy: false,\n                    target: targetElement,\n                    hideUploadButton: true,\n                    hideRetryButton: true,\n                    hideCancelButton: true,\n                    inline: true,\n                    debug:true,\n                    showRemoveButtonAfterComplete: true,\n                    showProgressDetails: false,\n                    showSelectedFiles: false,\n                    hideProgressAfterFinish: true\n                };\n            this.element.on('click', '.fileUploader' ,function (e) {\n                $(e.target).closest('.fileinput-button.form-buttons')\n                    .find('.uppy-Dashboard-browse').trigger('click');\n            });\n\n            const uppy = new Uppy.Uppy({\n                autoProceed: true,\n\n                onBeforeFileAdded: (currentFile) => {\n                    let fileSize,\n                        tmpl;\n\n                    fileSize = typeof currentFile.size == 'undefined' ?\n                        $.mage.__('We could not detect a size.') :\n                        byteConvert(currentFile.size);\n\n                    // check if file is allowed to upload and resize\n                    allowedResize = $.inArray(currentFile.extension, allowedExt) !== -1;\n\n                    if (!allowedResize)  {\n                        fileUploader.aggregateError(currentFile.name,\n                            $.mage.__('Disallowed file type.'));\n                        fileUploader.onLoadingStop();\n                        return false;\n                    }\n\n                    fileId = Math.random().toString(33).substr(2, 18);\n\n                    tmpl = progressTmpl({\n                        data: {\n                            name: currentFile.name,\n                            size: fileSize,\n                            id: fileId\n                        }\n                    });\n\n                    // code to allow duplicate files from same folder\n                    const modifiedFile = {\n                        ...currentFile,\n                        id:  currentFile.id + '-' + fileId,\n                        tempFileId:  fileId\n                    };\n\n                    $(tmpl).appendTo(self.element);\n                    return modifiedFile;\n                },\n\n                meta: {\n                    'form_key': window.FORM_KEY,\n                    isAjax : true\n                }\n            });\n\n            // initialize Uppy upload\n            uppy.use(Uppy.Dashboard, options);\n\n            // Resize Image as per configuration\n            if (this.options.isResizeEnabled) {\n                uppy.use(Uppy.Compressor, {\n                    maxWidth: this.options.maxWidth,\n                    maxHeight: this.options.maxHeight,\n                    quality: 0.92,\n                    beforeDraw() {\n                        if (!allowedResize) {\n                            this.abort();\n                        }\n                    }\n                });\n            }\n\n            // drop area for file upload\n            uppy.use(Uppy.DropTarget, {\n                target: targetElement,\n                onDragOver: () => {\n                    // override Array.from method of legacy-build.min.js file\n                    Array.from = null;\n                },\n                onDragLeave: () => {\n                    Array.from = arrayFromObj;\n                }\n            });\n\n            // upload files on server\n            uppy.use(Uppy.XHRUpload, {\n                endpoint: uploadUrl,\n                fieldName: 'image'\n            });\n\n            uppy.on('upload-success', (file, response) => {\n                if (response.body && !response.body.error) {\n                    self.element.trigger('addItem', response.body);\n                } else {\n                    fileUploader.aggregateError(file.name, response.body.error);\n                }\n\n                self.element.find('#' + file.tempFileId).remove();\n            });\n\n            uppy.on('upload-progress', (file, progress) => {\n                let progressWidth = parseInt(progress.bytesUploaded / progress.bytesTotal * 100, 10),\n                    progressSelector = '#' + file.tempFileId + ' .progressbar-container .progressbar';\n\n                self.element.find(progressSelector).css('width', progressWidth + '%');\n            });\n\n            uppy.on('upload-error', (error, file) => {\n                let progressSelector = '#' + file.tempFileId;\n\n                self.element.find(progressSelector).removeClass('upload-progress').addClass('upload-failure')\n                    .delay(2000)\n                    .hide('highlight')\n                    .remove();\n            });\n\n            uppy.on('complete', () => {\n                fileUploader.uploaderConfig.stop();\n                $(window).trigger('reload.MediaGallery');\n                Array.from = arrayFromObj;\n            });\n\n        }\n    });\n\n    return $.mage.mediaUploader;\n});\n"}
}});
